package com.testwa.distest.server.web.task.vo;import lombok.Data;import java.math.BigDecimal;/** * @Program: distest * @Description: * @Author: wen * @Create: 2018-05-27 21:06 **/@Datapublic class PerformanceDeviceOverviewVO {    private Double install;    private Double launch;    private Double cpu;    private Double ram;    private Double fps;    private Long down;    private Long up;    public void setInstall(Double d) {        BigDecimal bg = BigDecimal.valueOf(d);        this.install = bg.setScale(2, BigDecimal.ROUND_HALF_UP).doubleValue();    }    public void setLaunch(Double d) {        BigDecimal bg = BigDecimal.valueOf(d);        this.launch = bg.setScale(2, BigDecimal.ROUND_HALF_UP).doubleValue();    }    public void setCpu(Double d) {        BigDecimal bg = BigDecimal.valueOf(d);        this.cpu = bg.setScale(2, BigDecimal.ROUND_HALF_UP).doubleValue();    }    public void setRam(Double d) {        BigDecimal bg = BigDecimal.valueOf(d);        this.ram = bg.setScale(2, BigDecimal.ROUND_HALF_UP).doubleValue();    }    public void setFps(Double d) {        BigDecimal bg = BigDecimal.valueOf(d);        this.fps = bg.setScale(2, BigDecimal.ROUND_HALF_UP).doubleValue();    }}